const gl = pipeline.getContext('output-context').gl;
const image = document.getElementById('chess')
if(! window.chess_texture) window.buffer_texture = gl.createTexture();
gl.activeTexture(gl.TEXTURE0);
gl.bindTexture(gl.TEXTURE_2D, window.buffer_texture);
// Tell WebGL we want to affect texture unit 0


// Because images have to be downloaded over the internet
// they might take a moment until they are ready.
// Until then put a single pixel in the texture so we can
// use it immediately. When the image has finished downloading
// we'll update the texture with the contents of the image.
const level = 0;
const internalFormat = gl.RGBA;
const srcFormat = gl.RGBA;
const srcType = gl.UNSIGNED_BYTE;

if(image) gl.texImage2D(gl.TEXTURE_2D, level, internalFormat,
              srcFormat, srcType, image);


   // No, it's not a power of 2. Turn off mips and set
   // wrapping to clamp to edge
   gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.CLAMP_TO_EDGE);
   gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.CLAMP_TO_EDGE);
   gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR);
return 0

